import React from "react";
import "../App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { ListItemCardData } from "./ListItemCardData";
import { CardData } from "./CardData";
import { ReactComponent as GiftIcon } from "../assets/icons/gift.svg";
import { ReactComponent as NextIcon } from "../assets/icons/next.svg";

import {
  Container,
  Row,
  Col,
  Card,
  ListGroup,
  ListGroupItem,
} from "react-bootstrap";

function Cards() {
  return (
    <>
      <style type="text/css">
        {`
     .col {
      width: 343px
      }

     .row>* {
       padding-right: 43px;
       padding-left: 0;
      }

  .card {
    border-radius: 4px 20px 20px 20px;
    border: 0px;
    box-shadow: 0px 10px 20px rgba(233, 216, 207, 0.3);
    width: auto;
    height: 548px;
    
  }
  .card>.list-group:last-child {
    border-radius: 20px
  }

    .card-header  {
        color: #272931;
         background-color: #ffffff;
         height: 60px;
         border: 0px;
         justify-content: center;
         align-items: center;
      }

      .card-header:first-child {
        border-radius:  20px;
      }

    `}
      </style>
      <Row xs={1} md={2} className="g-4">
        <Col>
          <Card key={key}>
            <Card.Header className="bg">
              {item.iconHeader}
              <span>{item.titleHeader}</span>
              <span>{item.status}</span>
            </Card.Header>
            <Card.Img
              variant="top"
              src={require(`../assets/${item.image}.png`)}
            />
            <Card.Body>
              <Card.Title>{item.title}</Card.Title>
              <Card.Text>
                <GiftIcon />
                {item.giftTitle}
              </Card.Text>
            </Card.Body>
            {ListItemCardData.map((val, key) => {
              return (
                <ListGroup key={key} className="list-group-flush">
                  <ListGroupItem>
                    {val.item1}
                    <span>{item.item1}</span>
                    <NextIcon />
                  </ListGroupItem>
                  <ListGroupItem>
                    {val.item2}
                    <span>{item.item2}</span>
                    <NextIcon />
                  </ListGroupItem>
                  <ListGroupItem>
                    {val.item3}
                    <span>{item.item3}</span>
                  </ListGroupItem>
                  <ListGroupItem>
                    {val.item4}
                    <span>{item.item4}</span>
                  </ListGroupItem>
                </ListGroup>
              );
            })}
          </Card>

